INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.029, 1, 0, 1.5, 160, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 110, 122601, 1, 0, 1, 101, 1, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.014, 3, 0, 2.5, 120, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 105, 122401, 0, 1, 2, 102, 2, 111);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.017, 2, 1, 2.5, 350, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 110, 122501, 0, 0, 3, 103, 3, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.016, 3, 0, 1.5, 130, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 110, 107501, 0, 1, 4, 104, 4, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.014, 1, 0, 2.5, 160, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 110, 107601, 1, 0, 5, 105, 5, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.029, 2, 1, 3.5, 255, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 120, 107801, 0, 0, 6, 106, 6, 103);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.013, 1, 0, 3.5, 160, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 120, 110601, 1, 0, 7, 107, 7, 103);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.014, 2, 1, 2.5, 350, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 110, 110401, 0, 0, 8, 108, 8, 103);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.012, 3, 0, 1.5, 130, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 105, 110501, 0, 1, 9, 109, 9, 100);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.014, 1, 0, 2.5, 200, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 105, 115701, 1, 0, 10, 110, 10, 103);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.071, 2, 1, 2.5, 350, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 105, 113601, 0, 0, 11, 111, 11, 103);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.014, 3, 0, 1.5, 130, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 120, 107901, 0, 1, 12, 112, 12, 103);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.022, 2, 0, 1.5, 200, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 110, 108001, 1, 0, 13, 113, 13, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.031, 1, 0, 2.5, 160, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 110, 110301, 1, 0, 14, 114, 14, 108);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.036, 1, 0, 0.5, 130, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 110, 107701, 0, 1, 15, 115, 15, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.048, 2, 1, 3.5, 350, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 110, 113101, 0, 0, 16, 116, 16, 95);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.043, 3, 0, 1.5, 130, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 105, 113301, 0, 1, 17, 117, 17, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.018, 2, 0, 1.5, 130, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 105, 113201, 0, 1, 18, 118, 18, 95);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.021, 2, 0, 2.5, 160, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 110, 117001, 1, 0, 19, 119, 19, 108);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.036, 1, 1, 2.5, 255, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 110, 113501, 0, 0, 20, 120, 20, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.02, 3, 1, 2.5, 350, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 105, 113401, 0, 0, 21, 121, 21, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.018, 1, 0, 2.5, 130, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 110, 110101, 0, 1, 22, 122, 22, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.03, 3, 0, 3.5, 160, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 105, 110001, 1, 0, 23, 123, 23, 111);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.027, 1, 0, 1.5, 130, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 110, 117201, 0, 1, 24, 124, 24, 103);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.02, 2, 0, 3.5, 160, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 105, 117301, 1, 0, 25, 125, 25, 108);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.04, 3, 1, 2.5, 350, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 110, 117401, 0, 0, 26, 126, 26, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.009, 1, 1, 3.5, 350, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 110, 117101, 0, 0, 27, 127, 27, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.022, 1, 1, 3.5, 255, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 120, 122901, 0, 0, 28, 128, 28, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.028, 3, 0, 2.5, 130, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 110, 122801, 0, 1, 29, 129, 29, 105);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (0.023, 2, 0, 3.5, 130, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 105, 122701, 1, 0, 30, 130, 30, 108);
